import React from 'react';


export default function ExtendedTableRow(props){  
    return (   
        <div style={style.parentContent}>
           <div style={style.childContent}>

           </div>
        
        
        </div>
 

    )
}


const style = {
    parentContent: {
        backgroundColor: "blue",
        width: "100%",
        height: "400px",
        position: "relative"
    },

    childContent: {
        position: "absolute",
        width: "500px",
        right: "500px",
        backgroundColor
        
    }

};
